import React from 'react';


class Pokemon extends React.Component {


    state = {
        "pokemons-faction1": [
            {
                Name: "Pikachu",
                Icon: "https://www.flaticon.com/svg/static/icons/svg/188/188987.svg",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            },
            {
                Name: "Bulbasaur",
                Icon: "http://www.rw-designer.com/icon-image/14434-256x256x8.png",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 2
            },
            {
                Name: "Snorlax",
                Icon: "https://www.flaticon.com/svg/static/icons/svg/189/189001.svg",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 3
            }
        ],
        "pokemons-faction2": [
            {
                Name: "Charizard",
                Icon: "https://cdn.dribbble.com/users/1088894/screenshots/2631953/charizard-shot.jpg?compress=1&resize=800x600",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 4
            },
            {
                Name: "Mewtwo",
                Icon: "https://static.wikia.nocookie.net/pkmnshuffle/images/d/d3/Mewtwo.png/revision/latest/scale-to-width-down/128?cb=20170407192338",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 5
            },
            {
                Name: "Ditto",
                Icon: "https://cdn2.iconfinder.com/data/icons/pokemon-filledoutline/64/ditto-pokemon-nintendo-video-game-gaming-gartoon-monster-512.png",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 6
            }
        ]
    }

    changeDetails(pokemon) {
        console.log(pokemon.id)

    }
    render() {
        return (
            <div>
                {console.log(this.state['pokemons-faction1'][0].Name)}
                <h4>Faction 1</h4>

                <div id="faction-1">
                    <ul className="list-group">
                        {this.state['pokemons-faction1'].map(pokemon => (
                            <button onClick={(event) => this.changeDetails(pokemon)} key={pokemon.id}>
                                <li className="list-group-item d-flex justify-content-between align-items-center" >
                                    {pokemon.Name}
                                    <img src={pokemon.Icon} style={{ width: "30px", height: "30px" }} alt="Pokemon Icon" />
                                    <span className="badge badge-primary badge-pill">Att. Power: {pokemon.AttackPower} </span>
                                    <span className="badge badge-primary badge-pill">Def. Power: {pokemon.DefensePower} </span>
                                    <span className="badge badge-primary badge-pill">Total Health: {pokemon.TotalHealth} </span>

                                </li>
                            </button>
                        ))}
                    </ul>
                </div>

                <div id="faction-1">
                    <ul className="list-group">
                        {this.state['pokemons-faction2'].map(pokemon => (
                            <button onClick={(event) => this.changeDetails(pokemon)} key={pokemon.id}>
                                <li className="list-group-item d-flex justify-content-between align-items-center" >
                                    {pokemon.Name}
                                    <img src={pokemon.Icon} style={{ width: "30px", height: "30px" }} alt="Pokemon Icon" />
                                    <span className="badge badge-primary badge-pill">Att. Power: {pokemon.AttackPower} </span>
                                    <span className="badge badge-primary badge-pill">Def. Power: {pokemon.DefensePower} </span>
                                    <span className="badge badge-primary badge-pill">Total Health: {pokemon.TotalHealth} </span>

                                </li>
                            </button>
                        ))}
                    </ul>
                </div>


            </div>
        );
    }
};


export default Pokemon;
